import pdfMake from 'pdfmake/build/pdfmake';
pdfMake.fonts = {
  Roboto: {
    normal: 'BarlowCondensed-Regular',
    bold: 'BarlowCondensed-Bold',
    italics: 'BarlowCondensed-Italic',
    bolditalics: 'BarlowCondensed-BoldItalic'
  }
};
import pdfFonts from 'pdfmake/build/vfs_fonts';
import numbro from 'numbro';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

export default {
  getHojaVida(equipo) {
    let pdf = {
      header: function (currentPage, pageCount, pageSize) {
        if (currentPage === 1) {
          return {
            image: 'data:image/jpeg;base64,',
            fit: [600, 220]
          };
        }
      },
      content: [
        {
          margin: [0, 30, 0, 0],
          table: {
            widths: ['auto', '*', '*'],
            body: [
              [{ rowSpan: 3, text: 'HOJA DE VIDA DE EQUIPOS DE COMPUTO', alignment: 'center', style: 'titulos', image: 'https://picsum.photos/seed/picsum/200/300' }, { text: 'FECHA DE EMISIÓN', style: 'subtitulos' }, '29/03/2021'],
              ['', { text: 'VERSIÓN', style: 'subtitulos' }, '1'],
              ['', { colSpan: 2, text: 'DOCUMENTO CONTROLADO', alignment: 'center' }],
              [{ text: 'SERIAL PC', style: 'subtitulos' }, { colSpan: 2, text: equipo.serie, alignment: 'center' }],
            ]
          }
        },
        {
          margin: [0, 5, 0, 0],
          table: {
            widths: ['*', '*', '*', '*', '*', '*'],
            body: [
              [{ colSpan: 6, text: '1. DATOS DEL EQUIPO', style: 'titulos' }, '', '', '', '', ''],
              [
                { text: 'Marca', style: 'subtitulos' }, { text: (equipo.modelo !== null ? equipo.modelo.marca.nombre : 'No registra')  },
                { text: 'Modelo', style: 'subtitulos' }, { text: (equipo.modelo !== null ? equipo.modelo.descripcion : 'No registra')  },
                { text: 'Valor', style: 'subtitulos' }, { text: `$ ${numbro(equipo.valor).format({ thousandSeparated: true, mantissa: 0 })}` }
              ],
              [{ colSpan: 6, text: '2. CONFIGURACIÓN DE HARDWARE', style: 'titulos' }, '', '', '', '', ''],
              [
                { colSpan: 3, text: 'Procesador', style: 'subtitulos' }, '', '',
                { colSpan: 3, text: (equipo.modelo !== null ? `${equipo.modelo.procesador.nombre} ${equipo.modelo.procesador.frecuencia}` : 'No registra') }, '', '',
              ],
              [
                { colSpan: 3, text: 'Memoria RAM', style: 'subtitulos' }, '', '',
                { colSpan: 3, text: (equipo.memoria !== null ? `${equipo.memoria.capacidad} ${equipo.memoria.tipo}` : 'No registra') }, '', '',
              ],
              [
                { colSpan: 3, rowSpan: 2, text: 'Disco Duro', style: 'subtitulos' }, '', '',
                { text: 'Marca', style: 'subtitulos', alignment: 'center' },
                { text: 'Capacidad', style: 'subtitulos', alignment: 'center' },
                { text: 'Tecnologia', style: 'subtitulos', alignment: 'center' },
              ],
              [
                '', '', '', { text: (equipo.disco !== null ? equipo.disco.descripcion : 'No registra'), alignment: 'center' }, { text: (equipo.disco !== null ? equipo.disco.capacidad : 'No registra'), alignment: 'center' }, { text: (equipo.disco !== null ? equipo.disco.tipo : 'No registra'), alignment: 'center' }
              ],
              [
                { text: 'Perifericos', style: 'subtitulos' },
                { colSpan: 5, text: equipo.caracteristica.perifericos }, '', '', '', ''
              ],
              [{ colSpan: 6, text: '3. CONFIGURACIÓN DE RED', style: 'titulos' }, '', '', '', '', ''],
              [
                { colSpan: 2, text: 'Nombre de red', style: 'subtitulos' }, '',
                { colSpan: 4, text: equipo.caracteristica.nombre_red }, '', '',
              ],
            ]
          }
        },
        {
          margin: [0, 5, 0, 0],
          table: {
            widths: ['*', '*'],
            body: this.tablaDinamica(equipo.macs,
              [{ text: 'Tipo', style: 'subtitulos', col: 'tipo', alignment: 'center' }, { text: 'Mac', style: 'subtitulos', col: 'mac', alignment: 'center' }],
              [{ colSpan: 2, text: '4. DIRECCIONES MAC', style: 'titulos' }, ''],
            )
          }
        },
        {
          margin: [0, 5, 0, 0],
          table: {
            widths: ['*', '*', '*'],
            body: this.tablaDinamica(equipo.pantallas,
              [{ text: 'Tipo', style: 'subtitulos', col: 'tipo', alignment: 'center' }, { text: 'Marca', style: 'subtitulos', col: 'marca.nombre', alignment: 'center' }, { text: 'Pulgadas', style: 'subtitulos', col: 'pulgadas', alignment: 'center' }],
              [{ colSpan: 3, text: '5. MONITORES Y/O PANTALLAS', style: 'titulos' }, '', ''],
            )
          }
        },
        {
          margin: [0, 5, 0, 0],
          table: {
            widths: ['*'],
            body: this.tablaDinamica(equipo.sistema_operativos,
              [{ text: 'Sistema Operativo', style: 'subtitulos', col: 'nombre', alignment: 'center' }],
              [{ text: '6. SISTEMAS OPERATIVOS', style: 'titulos' }],
            )
          }
        },
        {
          margin: [0, 5, 0, 0],
          table: {
            widths: ['*', '*'],
            body: this.tablaDinamica(equipo.software,
              [{ text: 'Software', style: 'subtitulos', col: 'nombre', alignment: 'center' }, { text: 'Licencia', style: 'subtitulos', col: 'tipo', alignment: 'center' }],
              [{ colSpan: 2, text: '6. SOFTWARE', style: 'titulos' }, ''],
            )
          }
        },
        {
          margin: [0, 5, 0, 0],
          table: {
            widths: ['*', '*', '*', '*'],
            body: this.tablaDinamica(equipo.mantenimientos,
              [{ text: 'Fecha', style: 'subtitulos', col: 'created_at', alignment: 'center' }, { text: 'Tipo', style: 'subtitulos', col: 'tipo', alignment: 'center' }, { text: 'Categoria', style: 'subtitulos', col: 'categoria.nombre', alignment: 'center' }, { text: 'Tecnico', style: 'subtitulos', col: 'user.nombre', alignment: 'center' }],
              [{ colSpan: 4, text: '7. MANTENIMIENTOS', style: 'titulos' }, '', '', ''],
            )
          }
        },
        {
          margin: [0, 5, 0, 0],
          table: {
            widths: ['*', '*', '*'],
            body: this.tablaDinamica(equipo.asignaciones,
              [{ text: 'Fecha', style: 'subtitulos', col: 'created_at', alignment: 'center' }, { text: 'Ubicación', style: 'subtitulos', col: 'espacio.nombre', alignment: 'center' }, { text: 'Responsable', style: 'subtitulos', col: 'responsable.nombre', alignment: 'center' }],
              [{ colSpan: 3, text: '8. MOVIMIENTOS', style: 'titulos' }, '', ''],
            )
          }
        },
      ],
      styles: {
        titulos: {
          bold: true,
          fontSize: 16,
          fillColor: '#F08013',
          color: '#FFFFFF'
        },
        subtitulos: {
          bold: true,
          fontSize: 14,
          fillColor: '#ECEFF1'
        },
      },
    }
    pdfMake.createPdf(pdf).open();
  },

  tablaDinamica(data, columnas, tituloTabla) {
    let body = [];
    body.push(tituloTabla);
    body.push(columnas);
    if (data.length > 0) {
      data.forEach(function (row) {
        let dataRow = [];
        columnas.forEach(function (columna) {
          const cadenaCol = columna.col.split('.');
          if (cadenaCol.length > 1) {
            dataRow.push({ text: row[cadenaCol[0]][cadenaCol[1]], alignment: 'center' });
          } else {
            dataRow.push({ text: row[cadenaCol[0]], alignment: 'center' });
          }
        })
        body.push(dataRow);
      });
    } else {
      let dataRow = [];
      for (let i = 0; i < columnas.length; i++) {
        dataRow.push([{ text: 'No registra', alignment: 'center' }]);
      }
      body.push(dataRow);
    }

    return body;
  },
};
